// src/services/contribuinteService.js
export const getContribuintes = async () => {
  return [
    { id: 1, nome: 'Empresa A', tipo: 'Jurídico' },
    { id: 2, nome: 'João Silva', tipo: 'Pessoa Física' },
  ];
};
